import React from "react";
import { Link } from "react-router-dom";

const ItinNav = (props) => {
  return (
    <div>
      <Link path="/itinerary/22">May 22</Link>
      <Link path="/itinerary/23">May 23</Link>
      <Link path="/itinerary/24">May 24</Link>
      <Link path="/itinerary/25">May 25</Link>
      <Link path="/itinerary/26">May 26</Link>
      <Link path="/itinerary/27">May 27</Link>
      <Link path="/itinerary/28">May 28</Link>
      <Link path="/itinerary/29">May 29</Link>
      <Link path="/itinerary/30">May 30</Link>
    </div>
  );
};

export default ItinNav;
